{"body":[{"notHandleType":0,"problem_id":2,"rejectReason":"","status":"1","errorUrl":"https://www.pengan.gov.cn/zwgk/zfxxgknb/2023n/2023nbmxxgkgzndbg/202401/t20240123_1931706.html","transactUnit":"蓬安县电子政务服务中心","newOldDataFlag":1,"type":0,"createtime":"2024-01-28","id":313171,"wzmc":"蓬安县人民政府","displayContent":null,"description":"《年度报告》中“（二）依申请公开方面。2023年，我局未收到依申请公开申请事项”，与事实严重不符。本人于2023年10月31日向蓬安县行政审批局提出政府信息公开申请，并于2023年11月8日得到蓬安县行政审批局答复。","transactTime":"2024-02-04","transactResult":"周先生，你好！你反映的蓬安县行政审批局2023年政府信息公开工作年度报告中依申请公开内容与事实不符，情况属实，蓬安县行政审批局于2023年1月30日已对依申请公开内容完成了更正。感谢你对我县门户网站的关注。

 蓬安县电子政务服务中心 
2024年2月2日"}],"hasMoreItems":false}
